// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;

// require, revert, assert
// - gas refund, state updates are reverted
// custom error - save gas

contract Error {
    function testRequire(uint _i) public pure{
        require(_i <= 10, 'i > 10');
    }

    // Revert is rather suitable in complicated and nested loop.
    function testRevert(uint _i) public pure {
        if (_i > 10) {
            revert('i > 10');
        }
    }

    uint public num = 123;
    function alterVar() public {
        num = 122;
    }
    // Using "assert" to make sure variable always to be specific number.
    function testAssert() public view {
        assert(num == 123);
    }

    // Custom error can save gas.
    address payable owner = payable(msg.sender);
    error Unauthorized(address owner, address caller);
    function withdraw() public  {
        if (msg.sender != owner)
            // Too much error string cost more gas by old method
            // revert("error, only owner payable");

            // new method cost lower gas
            revert Unauthorized(owner, msg.sender);

        owner.transfer(address(this).balance);
    }
}

